-- Table structure for `t_user`
-- ----------------------------
DROP TABLE IF EXISTS `t_user`;
CREATE TABLE `t_user` (
  `id` varchar(64) NOT NULL COMMENT '',
  `t_userid` varchar(64) NOT NULL COMMENT 'sys_userid',
  `t_loginName` varchar(64) NOT NULL COMMENT '',
  `t_name` varchar(100) NOT NULL COMMENT '',
  `t_email` varchar(200) DEFAULT NULL COMMENT '',
  `t_phone` varchar(200) DEFAULT NULL COMMENT '',
  `QQ` varchar(200) DEFAULT NULL COMMENT 'QQ',
  `WX` varchar(200) DEFAULT NULL COMMENT 'WX',
  `t_photourl` varchar(255) DEFAULT NULL COMMENT '',
  `t_photoinfo` varchar(255) DEFAULT NULL COMMENT '',
  `t_company` varchar(255) DEFAULT NULL COMMENT '',
  `t_companyurl` varchar(255) DEFAULT NULL COMMENT '',
  `createtime` datetime DEFAULT NULL,
  `t_acount` decimal(10,2) DEFAULT '0.00' COMMENT '',
  `t_inviter` varchar(64) DEFAULT NULL COMMENT '',
  `reserve1` varchar(255) DEFAULT NULL COMMENT '',
  `reserve2` varchar(255) DEFAULT NULL COMMENT '1',
  `reserve3` varchar(255) DEFAULT NULL COMMENT '1',
  `reserve4` varchar(255) DEFAULT NULL COMMENT '1',
  `reserve5` varchar(255) DEFAULT NULL COMMENT '1',
  `create_by` varchar(64) NOT NULL COMMENT '',
  `create_date` datetime NOT NULL COMMENT '',
  `update_by` varchar(64) NOT NULL COMMENT '',
  `update_date` datetime NOT NULL COMMENT '',
  `remarks` varchar(255) DEFAULT NULL COMMENT '',
  `del_flag` char(1) NOT NULL DEFAULT '0' COMMENT '',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='';

